import styled from 'styled-components';

const Layout = styled.div`
  display: grid;
  grid-template-columns: 1fr;
  grid-template-rows: 200px 1fr 200px;
`;

const HomePage = () => {
  return (
    <Layout>
      <header></header>
      <main></main>
      <footer></footer>
    </Layout>
  );
};

export default HomePage;
